import React, { Component } from 'react';
import "./header.scss";
import "../../style/index.scss";

class Header extends Component {
    state = {}
    render() {
        return (
            <div className="container">
                <div className="container-inside">
                    Zaloguj
                </div>
            </div>
        );
    }
}

export default Header;
